استفد بجميع خدمات الكهرباء من مكانك! خدمات "الكهرباء" هي مجموعة خدمات إلكترونية مقدمة من خلال بوابة مصر الرقمية وتشمل العديد من الخدمات مثل شهادة بيانات تعاقد - شهادة بيانات استهلاك - تسجيل قراءة العداد - دفع الفواتير - تحويل طلبات الممارسات الي العدادات الكودية - تركيب عداد بدل فاقد - رفع عداد - تسجيل بيانات عداد بالحساب - فحص العداد - تركيب عداد قانوني لأول مرة - احسب فاتورتك - استعلام عن فواتير - تغيير نوع النشاط المتعاقد عليه - استخراج كارت شحن بدل تالف أو فاقد - تنازل عن ملكية عداد - استبدال عداد بقدرة أكبر - تصحيح قراءة عداد - تصحيح بيانات صاحب العداد - جدولة مديونية علي اقساط شهرية - سداد دفعة مقدمة للعداد الخاص بي - توصيل تيار كهربي للمباني السكنية - توصيل تيار وتركيب عداد إنشائي مؤقت - خدمة الأعطال والشكاوي - توصيل التيار الكهربائي للمنشآت الاستثمارية والمشروعات الصغيرة والمتوسطة - خدمة الاستفسارات والمقترحات

